import Netflix from './Netflix';
import Amazon from './Amazon';
import ('./index.css');

const netF = () =>{

    const favSeries = "netflix";
    const Favs = () => {
      if (favSeries === "netflix") {
        return <Netflix />;
      } else {
        return <Amazon />;
      }
    };
}
const amz = () =>{

    const favSeries = "amazon";
    const Favs = () => {
      if (favSeries === "netflix") {
        return <Netflix />;
      } else {
        return <Amazon />;
      }
    };
}


ReactDOM.render( 
    <>

    <h1 className="heading_style">List of top Netflix series in 2020
    <button onClick={netF()}>Netflix</button>
    <button>Amazon</button>
    </h1>
    
    <Favs />
    
    {/* {Sdata.map(ncard)}; */}
    </>,
    document.getElementById('root')
    );
